// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract NFTMarketplace {
    struct Listing {
        address seller;
        uint256 price;
    }
    
    // Mapping: NFT contract address => tokenId => Listing.
    mapping(address => mapping(uint256 => Listing)) public listings;
    
    event Listed(address indexed nftAddress, uint256 indexed tokenId, address seller, uint256 price);
    event Sold(address indexed nftAddress, uint256 indexed tokenId, address buyer, uint256 price);
    event Delisted(address indexed nftAddress, uint256 indexed tokenId, address seller);
    
    // List an NFT for sale.
    function listItem(address nftAddress, uint256 tokenId, uint256 price) public {
        IERC721 nft = IERC721(nftAddress);
        require(nft.ownerOf(tokenId) == msg.sender, "Not the owner");
        require(
            nft.getApproved(tokenId) == address(this) || nft.isApprovedForAll(msg.sender, address(this)),
            "Marketplace not approved"
        );
        
        listings[nftAddress][tokenId] = Listing({
            seller: msg.sender,
            price: price
        });
        emit Listed(nftAddress, tokenId, msg.sender, price);
    }
    
    // Buy a listed NFT.
    function buyItem(address nftAddress, uint256 tokenId) public payable {
        Listing memory listing = listings[nftAddress][tokenId];
        require(listing.price > 0, "Item not listed");
        require(msg.value >= listing.price, "Insufficient payment");
        
        // Transfer payment to the seller.
        payable(listing.seller).transfer(listing.price);
        // Transfer NFT ownership.
        IERC721(nftAddress).transferFrom(listing.seller, msg.sender, tokenId);
        
        // Remove the listing.
        delete listings[nftAddress][tokenId];
        emit Sold(nftAddress, tokenId, msg.sender, listing.price);
    }
    
    // Cancel a listing.
    function cancelListing(address nftAddress, uint256 tokenId) public {
        Listing memory listing = listings[nftAddress][tokenId];
        require(listing.seller == msg.sender, "Not the seller");
        delete listings[nftAddress][tokenId];
        emit Delisted(nftAddress, tokenId, msg.sender);
    }
}

contracts/NFTStaking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "./AstroMilkToken.sol";

contract NFTStaking {
    IERC721 public spaceBabiez;
    AstroMilkToken public milkToken;
    
    // Structure to track staking details.
    struct StakeInfo {
        uint256 tokenId;
        uint256 stakedAt;
        address owner;
    }
    
    // Example reward rate (tokens per second per NFT).
    uint256 public rewardRate = 1e18 / uint256(86400); // ~1 AMLK token per day per NFT
    
    // Mapping from tokenId to its staking details.
    mapping(uint256 => StakeInfo) public stakes;
    
    event Staked(address indexed owner, uint256 tokenId, uint256 timestamp);
    event Unstaked(address indexed owner, uint256 tokenId, uint256 reward);
    
    constructor(IERC721 _spaceBabiez, AstroMilkToken _milkToken) {
        spaceBabiez = _spaceBabiez;
        milkToken = _milkToken;
    }
    
    // Stake an NFT.
    function stake(uint256 tokenId) public {
        require(spaceBabiez.ownerOf(tokenId) == msg.sender, "Not the owner");
        // Transfer NFT to this contract.
        spaceBabiez.transferFrom(msg.sender, address(this), tokenId);
        stakes[tokenId] = StakeInfo({
            tokenId: tokenId,
            stakedAt: block.timestamp,
            owner: msg.sender
        });
        emit Staked(msg.sender, tokenId, block.timestamp);
    }
    
    // Unstake an NFT and claim rewards.
    function unstake(uint256 tokenId) public {
        StakeInfo memory stakeInfo = stakes[tokenId];
        require(stakeInfo.owner == msg.sender, "Not the staker");
        
        uint256 stakedDuration = block.timestamp - stakeInfo.stakedAt;
        uint256 reward = stakedDuration * rewardRate;
        
        // Remove the stake record.
        delete stakes[tokenId];
        
        // Return the NFT.
        spaceBabiez.transferFrom(address(this), msg.sender, tokenId);
        // Mint the reward tokens.
        milkToken.mint(msg.sender, reward);
        
        emit Unstaked(msg.sender, tokenId, reward);
    }
    
    // Claim accrued rewards without unstaking.
    function claim(uint256 tokenId) public {
        StakeInfo storage stakeInfo = stakes[tokenId];
        require(stakeInfo.owner == msg.sender, "Not the staker");
        
        uint256 stakedDuration = block.timestamp - stakeInfo.stakedAt;
        uint256 reward = stakedDuration * rewardRate;
        // Reset the staking timestamp.
        stakeInfo.stakedAt = block.timestamp;
        milkToken.mint(msg.sender, reward);
    }
}

contracts/SpaceBabiezNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract SpaceBabiezNFT is ERC721, Ownable, ReentrancyGuard {
    uint256 public tokenCounter;
    uint256 public mintPrice = 0.08 ether;
    
    // Structure holding dynamic traits for each Space Baby.
    struct Baby {
        uint256 level;
        uint256 generation;
        uint256 experience;
        string rarity; // Common, Uncommon, Rare, Epic, Legendary
    }
    
    // Mapping from token ID to its traits.
    mapping(uint256 => Baby) public babyData;
    
    // Events
    event BabyMinted(address indexed to, uint256 indexed tokenId, uint256 generation);
    event LevelUp(uint256 indexed tokenId, uint256 newLevel);
    event ExperienceGained(uint256 indexed tokenId, uint256 amount);
    event BabyBred(uint256 indexed parent1Id, uint256 indexed parent2Id, uint256 indexed childId);
    
    constructor() ERC721("SpaceBabiez", "SBABY") Ownable(msg.sender) ReentrancyGuard() {
        tokenCounter = 0;
    }
    
    // Mint a new Space Baby NFT (only owner can mint the initial OG babies).
    function mintBaby(address to) public payable nonReentrant returns (uint256) {
        if (msg.sender != owner()) {
            require(msg.value >= mintPrice, "Insufficient payment");
        }
        
        uint256 tokenId = tokenCounter;
        _safeMint(to, tokenId);
        babyData[tokenId] = Baby({
            level: 1,
            generation: 1,
            experience: 0,
            rarity: "Common"
        });
        
        tokenCounter++;
        
        emit BabyMinted(to, tokenId, 1);
        
        // Refund excess payment
        if (msg.value > mintPrice) {
            payable(msg.sender).transfer(msg.value - mintPrice);
        }
        
        return tokenId;
    }
    
    // Mint a baby with specified rarity (only owner can call)
    function mintBabyWithRarity(address to, string memory rarity) public onlyOwner returns (uint256) {
        uint256 tokenId = tokenCounter;
        _safeMint(to, tokenId);
        babyData[tokenId] = Baby({
            level: 1,
            generation: 1,
            experience: 0,
            rarity: rarity
        });
        
        tokenCounter++;
        
        emit BabyMinted(to, tokenId, 1);
        
        return tokenId;
    }
    
    // Grow up the Space Baby (increase its level) if it has enough experience
    function growUp(uint256 tokenId) public {
        require(ownerOf(tokenId) == msg.sender, "Not the owner");
        Baby storage baby = babyData[tokenId];
        
        // Calculate required experience: level * 100
        uint256 requiredExp = baby.level * 100;
        require(baby.experience >= requiredExp, "Not enough experience");
        
        // Calculate max level based on rarity
        uint256 maxLevel = getMaxLevel(baby.rarity);
        require(baby.level < maxLevel, "Already at max level");
        
        // Consume experience and level up
        baby.experience -= requiredExp;
        baby.level += 1;
        
        emit LevelUp(tokenId, baby.level);
    }
    
    // Breed two Space Babiez to create a new baby.
    function breed(uint256 parent1, uint256 parent2) public nonReentrant returns (uint256) {
        require(ownerOf(parent1) == msg.sender && ownerOf(parent2) == msg.sender, "Must own both parents");
        require(parent1 != parent2, "Cannot breed with self");
        
        Baby memory baby1 = babyData[parent1];
        Baby memory baby2 = babyData[parent2];
        
        // Both parents must be at least level 2
        require(baby1.level >= 2 && baby2.level >= 2, "Parents must be at least level 2");
        
        // For demonstration, the new baby's generation is one more than the lower generation of the two parents.
        uint256 newGeneration = (baby1.generation < baby2.generation ? baby1.generation : baby2.generation) + 1;
        
        // Determine rarity of child based on parents' rarities
        string memory childRarity = determineChildRarity(baby1.rarity, baby2.rarity);
        
        uint256 tokenId = tokenCounter;
        _safeMint(msg.sender, tokenId);
        babyData[tokenId] = Baby({
            level: 1,
            generation: newGeneration,
            experience: 0,
            rarity: childRarity
        });
        
        tokenCounter++;
        
        emit BabyBred(parent1, parent2, tokenId);
        emit BabyMinted(msg.sender, tokenId, newGeneration);
        
        return tokenId;
    }
    
    // Function to update experience
    function addExperience(uint256 tokenId, uint256 exp) public {
        require(_tokenExists(tokenId), "Token doesn't exist");
        require(ownerOf(tokenId) == msg.sender || msg.sender == owner(), "Not authorized");
        
        Baby storage baby = babyData[tokenId];
        baby.experience += exp;
        
        emit ExperienceGained(tokenId, exp);
        
        // Check if baby can level up automatically
        _checkForLevelUp(tokenId);
    }
    
    // Check if a baby can level up and do it automatically
    function _checkForLevelUp(uint256 tokenId) internal {
        Baby storage baby = babyData[tokenId];
        uint256 requiredExp = baby.level * 100;
        uint256 maxLevel = getMaxLevel(baby.rarity);
        
        if (baby.experience >= requiredExp && baby.level < maxLevel) {
            baby.experience -= requiredExp;
            baby.level++;
            
            emit LevelUp(tokenId, baby.level);
        }
    }
    
    // Get maximum level based on rarity
    function getMaxLevel(string memory rarity) public pure returns (uint256) {
        bytes32 rarityHash = keccak256(abi.encodePacked(rarity));
        
        if (rarityHash == keccak256(abi.encodePacked("Common"))) return 3;
        if (rarityHash == keccak256(abi.encodePacked("Uncommon"))) return 4;
        if (rarityHash == keccak256(abi.encodePacked("Rare"))) return 5;
        if (rarityHash == keccak256(abi.encodePacked("Epic"))) return 6;
        if (rarityHash == keccak256(abi.encodePacked("Legendary"))) return 7;
        
        return 3; // Default to Common max level
    }
    
    // Determine child's rarity based on parents' rarities
    function determineChildRarity(string memory rarity1, string memory rarity2) internal view returns (string memory) {
        // Basic implementation - more sophisticated logic could be used
        bytes32 r1 = keccak256(abi.encodePacked(rarity1));
        bytes32 r2 = keccak256(abi.encodePacked(rarity2));
        
        // If both parents are Legendary, child is Legendary
        if (r1 == keccak256(abi.encodePacked("Legendary")) && 
            r2 == keccak256(abi.encodePacked("Legendary"))) {
            return "Legendary";
        }
        
        // If one parent is Legendary, 50% chance for Epic
        if (r1 == keccak256(abi.encodePacked("Legendary")) || 
            r2 == keccak256(abi.encodePacked("Legendary"))) {
            // Use a hash of block data to generate "randomness" - replacing deprecated block.difficulty
            if (uint256(keccak256(abi.encodePacked(block.timestamp, block.prevrandao))) % 2 == 0) {
                return "Epic";
            } else {
                return "Rare";
            }
        }
        
        // Default to Common
        return "Common";
    }
    
    // Set mint price
    function setMintPrice(uint256 price) external onlyOwner {
        mintPrice = price;
    }
    
    // Withdraw contract funds
    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        (bool success, ) = payable(owner()).call{value: balance}("");
        require(success, "Transfer failed");
    }
    
    /**
     * @dev Helper function to check if a token exists
     * @param tokenId Token ID to check
     * @return bool True if the token exists
     */
    function _tokenExists(uint256 tokenId) internal view returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }
}

contracts/SpaceBabyNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.29;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

/**
 * @title SpaceBabyNFT
 * @dev ERC721 token for Space Babiez NFTs with enumeration and level-up functionality
 */
contract SpaceBabyNFT is ERC721, Ownable, ReentrancyGuard, Pausable {
    using Strings for uint256;
    
    // Total supply caps
    uint256 public constant MAX_ORIGIN_BABIES = 4000;
    uint256 public constant MAX_COLLECTOR_CARDS = 1000;
    
    // Current supply counters
    uint256 public totalOriginBabies;
    uint256 public totalCollectorCards;
    
    // Base URI for metadata
    string private _baseTokenURI;
    
    // Price configs
    uint256 public mintPrice = 0.08 ether; // Price in native currency (ETH/MATIC)
    
    // Mapping for token types and attributes
    mapping(uint256 => bool) public isCollectorCard;
    mapping(uint256 => uint256) public tokenLevel;
    mapping(uint256 => uint256) public tokenExperience;
    mapping(uint256 => string) public tokenRarity;
    
    // Events
    event BabyMinted(address indexed to, uint256 indexed tokenId, bool isCollectorCard);
    event LevelUp(uint256 indexed tokenId, uint256 newLevel);
    event ExperienceGained(uint256 indexed tokenId, uint256 amount);
    event PriceUpdated(uint256 newPrice);
    
    /**
     * @dev Constructor for SpaceBabyNFT
     * @param name Name of the NFT collection
     * @param symbol Symbol for the NFT collection
     * @param baseURI Base URI for token metadata
     * @param initialOwner Address that will be set as the initial owner
     */
    constructor(
        string memory name,
        string memory symbol,
        string memory baseURI,
        address initialOwner
    ) ERC721(name, symbol) Ownable(initialOwner) {
        _baseTokenURI = baseURI;
    }
    
    /**
     * @dev Mint a new Origin Baby NFT
     * @param to Address to mint the NFT to
     * @param rarity Rarity level of the NFT (Common, Uncommon, Rare, Epic, Legendary)
     */
    function mintOriginBaby(address to, string memory rarity) 
        external 
        payable 
        nonReentrant 
        whenNotPaused 
    {
        require(totalOriginBabies < MAX_ORIGIN_BABIES, "Max origin babies reached");
        require(msg.value >= mintPrice, "Insufficient funds");
        
        uint256 tokenId = totalOriginBabies + totalCollectorCards + 1;
        
        _safeMint(to, tokenId);
        isCollectorCard[tokenId] = false;
        tokenLevel[tokenId] = 1;
        tokenExperience[tokenId] = 0;
        tokenRarity[tokenId] = rarity;
        
        totalOriginBabies++;
        
        emit BabyMinted(to, tokenId, false);
        
        // Refund excess payment
        if (msg.value > mintPrice) {
            payable(msg.sender).transfer(msg.value - mintPrice);
        }
    }
    
    /**
     * @dev Mint a new Collector Card NFT
     * @param to Address to mint the NFT to
     * @param rarity Rarity level of the NFT
     */
    function mintCollectorCard(address to, string memory rarity) 
        external 
        payable 
        nonReentrant 
        whenNotPaused 
    {
        require(totalCollectorCards < MAX_COLLECTOR_CARDS, "Max collector cards reached");
        require(msg.value >= mintPrice, "Insufficient funds");
        
        uint256 tokenId = totalOriginBabies + totalCollectorCards + 1;
        
        _safeMint(to, tokenId);
        isCollectorCard[tokenId] = true;
        tokenLevel[tokenId] = 1;
        tokenExperience[tokenId] = 0;
        tokenRarity[tokenId] = rarity;
        
        totalCollectorCards++;
        
        emit BabyMinted(to, tokenId, true);
        
        // Refund excess payment
        if (msg.value > mintPrice) {
            payable(msg.sender).transfer(msg.value - mintPrice);
        }
    }
    
    /**
     * @dev Add experience to a token
     * @param tokenId Token ID to add experience to
     * @param amount Amount of experience to add
     */
    function addExperience(uint256 tokenId, uint256 amount) 
        external 
        whenNotPaused 
    {
        require(_tokenExists(tokenId), "Token does not exist");
        require(ownerOf(tokenId) == msg.sender || msg.sender == owner(), "Not authorized");
        
        tokenExperience[tokenId] += amount;
        
        emit ExperienceGained(tokenId, amount);
        
        // Check if token can level up
        _checkForLevelUp(tokenId);
    }
    
    /**
     * @dev Level up a token if it has enough experience
     * @param tokenId Token ID to level up
     */
    function levelUp(uint256 tokenId) 
        external 
        nonReentrant 
        whenNotPaused 
    {
        require(_tokenExists(tokenId), "Token does not exist");
        require(ownerOf(tokenId) == msg.sender, "Not token owner");
        
        // Experience required for level up = current level * 100
        uint256 requiredExp = tokenLevel[tokenId] * 100;
        require(tokenExperience[tokenId] >= requiredExp, "Not enough experience");
        
        // Get max level based on rarity
        uint256 maxLevel = getMaxLevel(tokenRarity[tokenId]);
        require(tokenLevel[tokenId] < maxLevel, "Max level reached");
        
        // Consume experience
        tokenExperience[tokenId] -= requiredExp;
        
        // Increase level
        tokenLevel[tokenId]++;
        
        emit LevelUp(tokenId, tokenLevel[tokenId]);
    }
    
    /**
     * @dev Get the maximum level a token can reach based on its rarity
     * @param rarity Rarity level
     * @return uint256 Maximum level
     */
    function getMaxLevel(string memory rarity) public pure returns (uint256) {
        bytes32 rarityHash = keccak256(abi.encodePacked(rarity));
        
        if (rarityHash == keccak256(abi.encodePacked("Common"))) return 3;
        if (rarityHash == keccak256(abi.encodePacked("Uncommon"))) return 4;
        if (rarityHash == keccak256(abi.encodePacked("Rare"))) return 5;
        if (rarityHash == keccak256(abi.encodePacked("Epic"))) return 6;
        if (rarityHash == keccak256(abi.encodePacked("Legendary"))) return 7;
        
        return 3; // Default to Common max level
    }
    
